import Head from "next/head";
import Navbar from "../Navbar/Navbar";
import './styles.module.scss'

const Layout = ({ children }) => (
    <div>
        <Head>
            <title>NextJs + Contentful Blog</title>
        </Head>

        <Navbar />
        {children}
    </div>
);

export default Layout;
